import { Icon } from '@iconify/react';
import pieChart2Fill from '@iconify/icons-eva/pie-chart-2-fill';
import peopleFill from '@iconify/icons-eva/people-fill';
import shoppingBagFill from '@iconify/icons-eva/shopping-bag-fill';
import fileTextFill from '@iconify/icons-eva/file-text-fill';
import flashOutline from '@iconify/icons-eva/flash-outline';
import calendarOutline from '@iconify/icons-eva/calendar-outline';
import fileTextOutline from '@iconify/icons-eva/file-text-outline';

// ----------------------------------------------------------------------

const getIcon = (name) => <Icon icon={name} width={22} height={22} />;

const sidebarConfig = [
  {
    title: 'dashboard',
    path: '/dashboard/app',
    icon: getIcon(pieChart2Fill)
  },
  {
    title: 'orders',
    path: '/dashboard/orders',
    icon: getIcon(fileTextOutline)
  },
  {
    title: 'offers',
    path: '/register',
    icon: getIcon(flashOutline)
  },
  {
    title: 'product',
    path: '/dashboard/products',
    icon: getIcon(shoppingBagFill)
  },
  {
    title: 'categories',
    path: '/dashboard/categories',
    icon: getIcon(calendarOutline)
  },
  {
    title: 'blog',
    path: '/dashboard/blog',
    icon: getIcon(fileTextFill)
  },
  {
    title: 'user',
    path: '/dashboard/user',
    icon: getIcon(peopleFill)
  }
];

export default sidebarConfig;
